import * as constants from '../constants/product'

const initState = {productsArr: []}
export default function ProductReducer(preState=initState, action){
    const {type, data} = action
    switch (type) {
        case constants.GET_PRODUCTS_REQ:

            return;

        default:
            return preState;
    }
}
